import React, { useEffect, useState } from "react";
import { AuthContext } from "../../AuthContextProvider";
import { useContext } from "react";

export default function AddPet() {

  const { userData } = useContext(AuthContext);

  const [formData, setFormData] = useState({
    type: "",
    name: "",
    height: "",
    weight: "",
    color: "",
    bio: "",
    age: "",
    hypoallergenic: false,
    dietary_restrictions: "",
    breed: "",
    adoption_status: "",
  });


  async function addPet(formData,id) {
    const url = 'http://localhost:8000/addPet';
    const data = {
      "type": formData.type,
      "name": formData.name,
      "adoption_status": formData.adoption_status,
      "picture": "https://w7.pngwing.com/pngs/68/852/png-transparent-catdog-season-2-cat-mammal-animals-cat-like-mammal-thumbnail.png",
      "height": formData.height,
      "weight": formData.weight,
      "color": formData.color,
      "bio": formData.bio,
      "hypoallergenic": formData.hypoallergenic,
      "age": formData.age,
      "breed":  formData.breed,
      "dietary_restrictions": formData.dietary_restrictions,
      "owner": id
    };
    const options = {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      },
      body: JSON.stringify(data)
    };
    try {
      const response = await fetch(url, options);
      const json = await response.json();
      console.log(json);
    } catch (error) {
      console.error('Error:', error);
    }
  }




    const handleSubmit = (event) => {
      event.preventDefault();
      setFormData({
        type: "",
        name: "",
        height: "",
        weight: "",
        color: "",
        bio: "",
        age: "",
        hypoallergenic: false,
        dietary_restrictions: "",
        breed: "",
        adoption_status: "",
      })
      sendFromDataToApi(formData);
    };

    function sendFromDataToApi() {
      addPet(formData,userData.id);
      setFormData({
        type: "",
        name: "",
        height: "",
        weight: "",
        color: "",
        bio: "",
        age: "",
        hypoallergenic: false,
        dietary_restrictions: "",
        breed: "",
      })

    }

    useEffect(() => {
      // console.log(formData);
    }, []);

    const handleInputChange = (event) => {
      const { name, value, type, checked } = event.target;
      const newValue = type === "checkbox" ? checked : value;
      setFormData({ ...formData, [name]: newValue });
    };
    return (
        <>
      <form onSubmit={handleSubmit}>
      <h1>Add a Pet</h1>
        <div className="formLine">
          <label htmlFor="type">Type:</label>
          <input
            type="text"
            name="type"
            value={formData.type}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="name">Name:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
    <label htmlFor="adoption_status">Adoption status:</label>
    <select
      name="adoption_status"
      value={formData.adoption_status}
      onChange={handleInputChange}
      required
    >
      <option value="adopted">Adopted</option>
      <option value="available">Available</option>
      <option value="foster">Foster</option>
    </select>
  </div>

        <div className="formLine">
          <label htmlFor="height">Height:</label>
          <input
            type="text"
            name="height"
            value={formData.height}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="weight">Weight:</label>
          <input
            type="text"
            name="weight"
            value={formData.weight}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="color">Color:</label>
          <input
            type="text"
            name="color"
            value={formData.color}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="bio">Bio:</label>
          <input
            name="bio"
            value={formData.bio}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="age">Age:</label>
          <input
            type="number"
            name="age"
            value={formData.age}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="hypoallergenic">Hypoallergenic:</label>
          <input
            type="checkbox"
            name="hypoallergenic"
            checked={formData.hypoallergenic}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="dietary_restrictions">Dietary Restrictions:</label>
          <input
            type="text"
            name="dietary_restrictions"
            value={formData.dietary_restrictions}
            onChange={handleInputChange}
          />
        </div>
        <div className="formLine">
          <label htmlFor="breed">Breed:</label>
          <input
            type="text"
            name="breed"
            value={formData.breed}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit nakedButton">Add Pet</button>
      </form>
      </>
    );
  };
